import React from "react";

function Popped({ children }) {
    return (
        <Tippy
            render={attrs => (
                <div className="box" tabIndex="-1" {...attrs}>
                    Search
                </div>
            )}
        >
            {children}
        </Tippy>
    )
}

export default Popped;
